import React from 'react'
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import SideNav from '../../Components/SideNav'
import Typography from '@mui/material/Typography';
import '../Single_user/Single_user.scss'
const drawerWidth = 250;
export default function Single_user() {
    return (
        <>
            <Box sx={{ display: 'flex', flexDirection: 'column' }}>
                <SideNav />

                <Toolbar sx={{
                    width: { md: `calc(100% - ${drawerWidth}px)` },
                    ml: { md: `${drawerWidth}px` }
                }} />
                <Box sx={{
                    width: { md: `calc(100% - ${drawerWidth}px)` },
                    ml: { md: `${drawerWidth}px` }
                }} >


                    <div className='Single_user_container'>
                        <div className='container-fluid bg-light my-3'>
                            <div className='row m-0 p-0 bg-info'>
                                <div className='col-lg-4 col-md-12 bg-success'>images</div>
                                <div className='col-lg-8 col-md-12 bg-dark '>
                                    <p className='d-flex justify-content-between row m-0 p-0'><span className='col-3 h5'>Name:</span><span className='col-9' style={{ fontSize: '15px' }}>Amit kumar yadav</span></p>
                                    <p className='d-flex justify-content-between row m-0 p-0'><span className='col-3 h5'>Email:</span><span className='col-9' style={{ fontSize: '15px', wordWrap: 'break-word' }}>yaduvanshiamit545@gmail.com</span></p>
                                    <p className='d-flex justify-content-between row m-0 p-0'><span className='col-3 h5'>Mobile:</span><span className='col-9' style={{ fontSize: '15px' }}>6388131984</span></p>
                                    <p className='d-flex justify-content-between row m-0 p-0'><span className='col-3 h5'>Gender:</span><span className='col-9' style={{ fontSize: '15px' }}>Male</span></p>
                                    <p className='d-flex justify-content-between row m-0 p-0'><span className='col-3'>Adderss:</span><span className='col-9' style={{ fontSize: '15px' }}>122/7 atrauli lucknow uttar pradesh</span></p>


                                </div>
                            </div>
                        </div>
                    </div>



                </Box>


            </Box>
        </>
    )
}
